import styled from "styled-components";
import IconButton from '@material-ui/core/IconButton';

export const Wrapper = styled.div`
    margin: 100px 40px 40px 40px;
`;

export const StyledButton  = styled(IconButton)`
    position: fixed;
    z-index: 100;
    right: 20px;
    top: 10px;
    background: tomato;
    color: #fff;
`;
